class Feedback{constructor(n="INFO",t="Sua mensagem aqui.",i=null,r=5){this.tipo=n;this.mensagem=t;this.mensagemAdicional=i;this.tipoAcao=r}static converter(n){return n==null||!n.hasOwnProperty("tipoDescricao")||!n.hasOwnProperty("mensagem")?null:new Feedback(n.tipoDescricao,n.mensagem,n.hasOwnProperty("mensagemAdicional")?n.mensagemAdicional:null,n.hasOwnProperty("tipoAcao")?n.tipoAcao:null)}exibir(n){let t="info";switch(this.tipo.toUpperCase()){case"ATENCAO":t="warning";break;case"ERRO":t="error";break;case"SUCESSO":t="success"}let i=this.tipoAcao;Swal.fire({title:this.mensagem,html:this.mensagemAdicional,type:t,allowOutsideClick:!1}).then(()=>{if(n!=null)n(),swal.close();else switch(i){case 1:window.history.back();break;case 2:window.close();break;case 3:location.href=App.corrigirPathRota("/dashboard");break;case 4:location.reload();break;case 5:AppModal.ocultar();break;case 6:location.href=App.corrigirPathRota("/login")}})}}